import React from 'react'
import Account from '../menu/acc.svg';
import '../mainWindow/window.css';

const styles = {
    text:{
        display: 'flex', 
    }
}

 const PersonRate = (props) =>{
    return(
        <li style={styles.text} >
            <div>
                <img src={props.avatar}/>
            </div>
            <span>{props.name}</span>
        </li>
    )
}

export default PersonRate;
